//underground.works/blog/clockwork-5.3-released-with-http-requests-and-mode",notes:[{title:"HTTP Requests",text:["This new tab shows HTTP requests executed by your application, including details like request and response bodies and headers.","Requests executed via the Laravel HTTP client are automatically collected and you can also easily collect any Guzzle based library."],image:"http-requests.png",imagePlacement:"right"},{title:"Server-side Library Updated",text:["The server-side library was also updated with support for collecting HTTP requests, improved Vanilla integration and more.",'For the full list of improvements, changes, and fixes click on the "learn more" button.']}]},{version:"5.1",url:"https://underground.works/blog/clockwork-5.1-released-with-database-queries-highlighting-and-more",notes:[{title:"Database Queries Highlighting",text:["Database queries are now easier to read with SQL syntax highlighting. You can also enable the prettify mode to reformat the queries for even more readibility."],image:"database-queries.png",imagePlacement:"top"},{title:"Server-side Library Updated",text:["The server-side library was also updated with support for Laravel Octane, collecting cache values and more.",'For the full list of improvements, changes, and fixes click on the "learn more" button.']}]},{version:"5.0",url:"https://underground.works/blog/clockwork-5.0-released-with-client-side-metrics-toolbar-and-more",notes:[{title:"UI refinements",text:["Almost every part of the Clockwork UI was touched up and improved. From simplified requests list, new tab bar, counters and tables to reworked dark theme colors.",'You will also find a new "credits" link in the settings modal. This opens a credits modal with a little shout-out to all contributors, sponsors and used third-party dependencies.'],image:"clockwork-5.png",imagePlacement:"top"},{title:"Timeline",text:["Timeline was rebuilt from the ground up in this release.","The new timeline makes it easier than ever before 